n        font-family: arial;\r\n    }\r\n</style>\r\n<div id=\"divNewsContent\" class=\"fon34 mt3 mr2 fon43 detail-content\">\r\n    <p>ThÃ´ng tin vá» vá»¥ táº¥n cÃ´ng nÃ y Ä‘Æ°á»£c bÃ¡o al-Hadath ngÃ y 31/1 dáº«n nguá»“n tin ChÃ­nh phá»§ Syria cho biáº¿t, sá»± viá»‡c xáº£y ra chá»‰ 10 phÃºt sau khi mÃ¡y bay háº¡ cÃ¡nh. Má»™t tÃªn lá»­a Ä‘Ã£ rÆ¡i gáº§n Ä‘Æ°á»ng bÄƒng vÃ  chá»‰ cÃ¡ch chiáº¿c mÃ¡y bay khoáº£ng 50m. KhÃ´ng cÃ³ thÃ´ng tin vá» thÆ°Æ¡ng vong trong vá»¥ táº¥n cÃ´ng báº±ng tÃªn lá»­a nÃ y.</p>\n\n<p>Trong khi Ä‘Ã³, nguá»“n tin tá»« TÃ¢n Hoa xÃ£ cho biáº¿t, phiáº¿n quÃ¢n Ä‘Ã£ nÃ£ sÃºng cá»‘i vÃ o sÃ¢n bay quá»‘c táº¿ Damascus. ToÃ n bá»™ 172 hÃ nh khÃ¡ch trÃªn mÃ¡y bay Ä‘Ã£ Ä‘Æ°á»£c sÆ¡ tÃ¡n. Sau vá»¥ táº¥n cÃ´ng, chiáº¿n Ä‘áº¥u cÆ¡ cá»§a KhÃ´ng quÃ¢n Syria Ä‘Ã£ xuáº¥t hiá»‡n trÃªn vÃ¹ng trá»i khu vá»±c Ghouta á»Ÿ miá»n ÄÃ´ng Syria hiá»‡n do phiáº¿n quÃ¢n kiá»ƒm soÃ¡t vÃ  lÃ  nÆ¡i báº¯n Ä‘i loáº¡t sÃºng cá»‘i Ä‘á»ƒ truy lÃ¹ng káº» táº¥n cÃ´ng.</p>\n\n<div class=\"VCSortableInPreviewMode IMSCurrentEditorEditObject\" type=\"Photo\">\n<div><img alt=\"\nSÃ¢n bay quá»‘c táº¿ Damascus.\n\" id=\"img_ecacdef0-08c2-11e8-8cb7-c7cf49dd1388\" photoid=\"ecacdef0-08c2-11e8-8cb7-c7cf49dd1388\" src=\"https://dantricdn.com/2018/2/3/photo-0-15176493959141776575742.jpg\" rel=\"https://dantricdn.com/2018/2/3/photo-0-15176493959141776575742.jpg\" type=\"photo\" data-original=\"https://dantricdn.com/2018/2/3/photo-0-15176493959141776575742.jpg\" w=\"480\" h=\"270\"></div>\n\n<div class=\"PhotoCMS_Caption\">\n<p style=\"text-align:center;margin:0px;\">SÃ¢n bay quá»‘c táº¿ Damascus.</p>\n</div>\n</div>\n\n<p>CÃ¹ng vá»›i Ä‘Ã³, hÃ£ng thÃ´ng táº¥n nhÃ  nÆ°á»›c SANA cá»§a Syria cho biáº¿t lá»±c lÆ°á»£ng phiáº¿n quÃ¢n Ä‘Ã£ báº¯n 2 quáº£ tÃªn lá»­a trÃºng vÃ o khu vá»±c sÃ¢n bay dÃ¢n sá»± cá»§a thá»§ Ä‘Ã´ Damascus, song khÃ´ng gÃ¢y thÆ°Æ¡ng vong.</p>\n\n<p>Vá»¥ táº¥n cÃ´ng nÃ³i trÃªn xáº£y ra sau khi Äáº¡i há»™i Ä‘á»‘i thoáº¡i dÃ¢n tá»™c Syria á»Ÿ Sochi, Nga káº¿t thÃºc ngÃ y trÆ°á»›c Ä‘Ã³ vá»›i tuyÃªn bá»‘ Ä‘á»“ng Ã½ thÃ nh láº­p má»™t á»¦y ban Hiáº¿n phÃ¡p má»›i. á»¦y ban nÃ y bao gá»“m cÃ¡c Ä‘áº¡i biá»ƒu Ä‘Æ°á»£c báº§u táº¡i Há»™i nghá»‹, cÅ©ng nhÆ° Ä‘áº¡i diá»‡n cá»§a cÃ¡c nhÃ³m khÃ´ng tham dá»±.</p>\n\n<p>TrÆ°á»›c Ä‘Ã³, cÃ¡c nhÃ³m chiáº¿n binh ngÆ°á»i Kurd tham dá»± há»™i nghá»‹ hÃ²a bÃ¬nh á»Ÿ Sochi Ä‘Ã£ tá»• chá»©c má»™t cuá»™c há»p kÃ­n vá»›i nÆ°á»›c chá»§ nhÃ  Nga. CÃ¡c thÃ nh viÃªn Armenia cá»§a Quá»‘c há»™i Syria Ä‘Ã£ Ä‘áº¿n Sochi, Ä‘á»ƒ tham gia vÃ o Há»™i nghá»‹ Ä‘á»‘i thoáº¡i dÃ¢n tá»™c Syria do Nga tá»• chá»©c.</p>\n\n<p>Nghá»‹ sÄ© Nora Arisyan vÃ  Zhirayr Reisyan Ä‘áº¡i diá»‡n cho bá»™ pháº­n dÃ¢n cÆ° Armenia táº¡i Syria tham gia vÃ o cÃ¡c nhÃ³m dÃ¢n tá»™c vÃ  tÃ´n giÃ¡o khÃ¡c Ä‘á»ƒ Ä‘Æ°a ra Ã½ kiáº¿n táº¡i Há»™i nghá»‹ Ä‘á»‘i thoáº¡i dÃ¢n tá»™c Syria.</p>\n\n<p>NgoÃ i ra, pháº§n lá»›n cÃ¡c Ä‘áº¡i biá»ƒu lÃ  ngÆ°á»i áº¢ ráº­p Syria, Yazidis, Assyrians, Armenians, Circassians, Chechen, Daghestani, Abkhazians, vÃ  Turkmens cÅ©ng Ä‘Ã£ cÃ³ máº·t Ä‘á»ƒ tham dá»± há»™i nghá»‹.</p>\n\n<p>Äáº¡i sá»© Ä‘áº·c biá»‡t cá»§a Syria táº¡i LiÃªn Há»£p Quá»‘c Staffan de Mistura xÃ¡c nháº­n tham gia Äáº¡i há»™i táº¡i Syria. Viá»‡c tham gia cá»§a Ã´ng Staffan de Mistura sáº½ giÃºp phá»¥c há»“i tiáº¿n trÃ¬nh Geneva vÃ  tiáº¿n tá»›i Ä‘Ã m phÃ¡n bÃ¬nh thÆ°á»ng giá»¯a chÃ­nh phá»§ Syria vÃ  phe Ä‘á»‘i láº­p.</p>\n\n<p>Viá»‡c cÃ¡c thÃ nh viÃªn tham dá»± Há»™i nghá»‹ Ä‘á»‘i thoáº¡i dÃ¢n tá»™c Syria á»Ÿ Sochi Ä‘á»“ng Ã½ thÃ nh láº­p má»™t á»¦y ban Hiáº¿n phÃ¡p má»›i lÃ  thÃ nh tá»±u lá»›n lao trong tiáº¿n trÃ¬nh hÃ²a giáº£i á»Ÿ Syria sau 7 nÄƒm ná»™i chiáº¿n. NÃ³ thá»ƒ hiá»‡n vai trÃ² chá»§ Ä‘áº¡o vÃ  tÃ i nÄƒng Ä‘Ã m phÃ¡n cá»§a Nga.</p>\n\n<p>ThÃ nh cÃ´ng cá»§a Há»™i nghá»‹ táº¡i Sochi Ä‘Ã£ chá»©ng minh Ä‘Æ°á»£c vai trÃ² quan trá»ng cá»§a Nga lÃ  má»™t nhÃ  hÃ²a giáº£i hÃ²a bÃ¬nh khÃ´ng chá»‰ táº¡i Syria mÃ  cÃ²n cáº£ á»Ÿ Trung ÄÃ´ng nÃ³i chung - má»™t vai trÃ² mÃ  vá»‘n do ngÆ°á»i Má»¹ náº¯m giá»¯ báº¥y lÃ¢u nay.</p>\n\n<p>Má»¥c tiÃªu chÃ­nh