);\r\n        }\r\n    });\r\n    //end cho trang chi tiet ims\r\n</script>\r\n<script type=\"text/lazyscript\">\r\n    //dang anh 360\r\n    var LoadBox360Details = {\r\n        width: 460,\r\n        height: 330,\r\n        frameTime: 150,\r\n        init: function (control) {\r\n            var me = this;\r\n            var $control = $(control);\r\n            var id = $control.attr(\'id\').replace(\'s2s_wrap-\', \'\');\r\n            $.ajax({\r\n                url: appSettings.ajaxDomain + \"/Handlers/Image360.ashx\",\r\n                data: { \'command\': \'boxgallerydetails\', \'id\': id },\r\n                xhrFields: {\r\n                    withCredentials: true\r\n                },\r\n                type: \"GET\",\r\n                success: function (data) {\r\n                    data = eval(\'(\' + data + \')\');\r\n                    if (data.Success === true) {\r\n\r\n                        //\r\n                        var w360 = 460;\r\n                        var h360 = 330;\r\n                        $control.append(String.format(\'<div id=\"slide-360-{0}\"></div><i class=\"spin-desc\" id=\"spin-desc-{0}\">DÃ¹ng chuá»™t Ä‘á»ƒ xoay áº£nh &#8596;</i><input class=\"reload-spin\" type=\"button\" value=\"Play\" id=\"reload-spin-{0}\" />\', id));\r\n\r\n                        var desc = $control.find(\'.spin-desc\');\r\n                        var l = (me.width - desc.width()) / 2;\r\n                        desc.css(\'left\', l + \"px\");\r\n\r\n                        $control.css(\'height\', \'auto\');\r\n\r\n                        var slides = [];\r\n\r\n                        for (var i = 0; i < data.Data.length; i++) {\r\n                            //slides[i] = appSettings.imageDomain + \'/\' + data.Data[i].RawImage;\r\n\r\n                            slides[i] = appSettings.imageDomain + \'/\' + data.Data[i].ImageUrl;\r\n                            //alert(slides[i]);\r\n                            if (i == 0) {\r\n                  