INSERT INTO `t_news` VALUES ('79745', '28', 'I still wanna have some fun, says Sheryl Crow', 'When Missouriâ€™s Sheryl Crow secured her big break with All I Wanna Do, she glorified a carefree lifestyle in which drinking beer at noon was the norm. The single was a breezy celebration.', '2017-04-21 01:27:23', 'http://www.dailymail.co.uk/tvshowbiz/article-4431012/I-wanna-fun-says-Sheryl-Crow.html', 'http://i.dailymail.co.uk/i/pix/2017/04/21/01/3F5A44D300000578-0-image-m-13_1492733701908.jpg', null, null);
INSERT INTO `t_news` VALUES ('79746', '28', 'Gemma Arterton leads cast in tale of Britain\'s finest hour', 'Their Finest has also sprung from a book, in this case a novel by Lissa Evans about the making of a propaganda film thinly disguised as a drama, at the height of the Blitz.', '2017-04-21 08:14:13', 'http://www.dailymail.co.uk/tvshowbiz/article-4430994/Gemma-Arterton-leads-cast-tale-Britain-s-finest-hour.html', 'http://i.dailymail.co.uk/i/pix/2017/04/21/01/3F5A0EA100000578-0-image-a-95_1492734570113.jpg', null, null);
