INSERT INTO `t_news` VALUES ('79748', '28', 'Idris Elba\'s the boss on both sides of the camera', 'Film-maker and actor Idris Elba goes behind the camera on Monday to direct his first feature movie. Yardie is about a Jamaican gangsta out to crack the cocaine market in North London.', '2017-05-12 01:30:45', 'http://www.dailymail.co.uk/tvshowbiz/article-4498014/Idris-Elba-s-boss-sides-camera.html', 'http://i.dailymail.co.uk/i/pix/2017/05/12/01/4034BCD600000578-0-image-m-60_1494548309273.jpg', null, null);
INSERT INTO `t_news` VALUES ('79749', '28', 'ADRIAN THRILLS on Harry Styles\' solo debut', 'Harry Styles (pictured) has bided his time since the world\'s most successful pop act began a hiatus a year ago, but this debut offering suggests his career is now heading in a very different direction.', '2017-05-12 01:54:18', 'http://www.dailymail.co.uk/tvshowbiz/article-4498098/Solo-debut-Harry-Styles-engaging-effort.html', 'http://i.dailymail.co.uk/i/pix/2017/05/12/01/4035C18D00000578-0-image-m-89_1494549524483.jpg', null, null);
INSERT INTO `t_news` VALUES ('79750', '28', 'BRIAN VINER: Depp in Pirates of the Caribbean has buckled', 'Every time the movie has the wind in its sails, up lurches Captain Jack with another unfunny wisecrack or pratfall, reminding you the charm Depp once had has gone, writes BRIAN VINER.', '2017-06-05 08:43:26', 'http://www.dailymail.co.uk/tvshowbiz/article-4543494/BRIAN-VINER-Depp-Pirates-Caribbean-buckled.html', 'http://i.dailymail.co.uk/i/pix/2017/05/26/00/40CCD5AB00000578-0-image-a-52_1495756525488.jpg', null, null);
INSERT INTO `t_news` VALUES ('79751', '28', 'Richard Gere\'s Norman conquest is perfectly cast', 'Norman, with its unwieldy sub-title The Moderate Rise And Tragic Fall Of A New York Fixer, is a quietly compelling gem of a movie.', '2017-06-09 01:56:04', 'http://www.dailymail.co.uk/tvshowbiz/article-4586834/Richard-Gere-s-Norman-conquest-perfectly-cast.html', 'http://i.dailymail.co.uk/i/pix/2017/06/09/01/411F015300000578-0-image-m-57_1496969265462.jpg', null, null);
INSERT INTO `t_news` VALUES ('79752', '28', 'Wilson is an engaging dark comedy, says BRIAN VINER', 'The U.S. reviews of this film have been distinctly mediocre, but I loved it, maybe because Iâ€™m a sucker for a really good screen misanthrope. And Woody Harrelsonâ€™s Wilson is right up there.', '2017-06-09 01:57:18', 'http://www.dailymail.co.uk/tvshowbiz/article-4586906/Wilson-engaging-dark-comedy-says-BRIAN-VINER.html', 'http://i.dailymail.co.uk/i/pix/2017/06/09/01/411FB53000000578-0-image-a-15_1496969699809.jpg', null, null);
INSERT INTO `t_news` VALUES ('79753', '28', 'Hugh Laurie wanted to star in The Night Manager', 'Hugh Laurie shattered the mould with his spine-tingling menace as the billionaire arms dealer Richard Roper in BBCâ€™s The Night Manager (pictured). But could he have played the hero?', '2017-06-09 02:27:10', 'http://www.dailymail.co.uk/tvshowbiz/article-4586930/Hugh-Laurie-wanted-Night-Manager.html', 'http://i.dailymail.co.uk/i/pix/2017/06/09/02/317B84BD00000578-0-image-m-68_1496971376015.jpg', null, null);
INSERT INTO `t_news` VALUES ('79754', '28', 'Katy Perry WItness picks fine time to grow up gracefully', 'ADRIAN THRILLS: Witness keeps abreast of current trends, but the songs are generally slower and more introspective than before, with fewer high-octane dance numbers.', '2017-06-09 02:31:00', 'http://www.dailymail.co.uk/tvshowbiz/article-4586836/Katy-Perry-WItness-picks-fine-time-grow-gracefully.html', 'http://i.dailymail.co.uk/i/pix/2017/06/09/02/411B85EB00000578-0-image-m-52_1496970214756.jpg', null, null);
INSERT INTO `t_news` VALUES ('79755', '28', 'Captain America Chris Evans\' bond with young co-star', 'BAZ BAMIGBOYE: Chris Evans is looking tough-guy fit: honed and toned with biceps bulging. Heâ€™s Captain America on screen the last dude youâ€™d expect to get misty eyed over his leading lady.', '2017-06-09 03:01:47', 'http://www.dailymail.co.uk/tvshowbiz/article-4586878/The-girl-stole-Captain-America-Chris-Evans-s-heart.html', 'http://i.dailymail.co.uk/i/pix/2017/06/09/01/4133FA5D00000578-0-image-m-19_1496968516833.jpg', null, null);
INSERT INTO `t_news` VALUES ('79756', '28', 'The Mummy review by Brian Viner', 'We all like a few hieroglyphics with our hokum, but this is too much, an absolute barrage of digitally enhanced silliness that not even Tom Cruise and Russell Crowe can save.', '2017-06-09 04:58:06', 'http://www.dailymail.co.uk/tvshowbiz/article-4586662/Curse-crummy-Mummy.html', 'http://i.dailymail.co.uk/i/pix/2017/06/09/00/411F15E800000578-0-image-a-11_1496965442763.jpg', null, null);
INSERT INTO `t_news` VALUES ('79757', '28', 'Jennifer Aniston opens the doors to the stunning LA estate', '\'I look around at my husband and my dogs and our home, and thereâ€™s nowhere else I want to be,\' the actress, 48, explained to the publication. The home was designed by A. Quincy Jones.', '2018-02-07 16:36:07', 'http://www.dailymail.co.uk/tvshowbiz/article-5363059/Jennifer-Aniston-opens-doors-stunning-LA-estate.html', 'http://i.dailymail.co.uk/i/pix/2018/02/07/16/48F7645400000578-0-image-a-5_1518019564742.jpg', null, null);
